var ctr = 0;
var snd = new Audio("data:audio/wav;base64,");
let captchaInterval = setInterval(() => {
	var xPathRes = document.evaluate('//*[@id="router-container"]/div/div[3]/div[2]/div/div/div[2]/div[2]/div[2]/div/div/div[4]', document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null);
	if (xPathRes.singleNodeValue != null) {
		if(ctr == 1){
		snd.play();
		xPathRes.singleNodeValue.click();
		ctr = 0;
		setTimeout(function(){ xPathRes = document.evaluate('//*[@id="solver-button"]', document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null); 
		xPathRes.singleNodeValue.click();
		}, 4000);
	}
  }else{ctr = 1;}
}, 2000);
